Alektra Blue, Asa Akira, Madison Ivy, Misty Stone, Cassandra Cruz, Skylar Price,
Brad Armstrong, Danny Mountain, Michael Vegas, Tommy Gunn, Dale Dabone

Karen (Alektra Blue) sees the world a little differently than most. Her days are spent seeing an endless parade of horny guys from her little peepshow booth.
When down on his luck ex-stock broker Ryan (Dale Dabone) shows up on the other side of the glass the unlikely pair decide to give love a shot with hilarious results.
Great acting, great sex, and a great story make Peepshow a must see. Put your money in the slot, wait for the curtain to rise... the show is about to begin!
